Take a tour of @teleo.ai's CONEXPO-CON/AGG booth with Vinay Shet, Teleo's Co-founder and CEO. At this year's Las Vegas show, Teleo showcased supervised autonomy across two demos: a short-range demo with an onsite skid-steer, and a long-range demo with two machines in Northern California.

Teleo retrofits existing heavy equipment and turns them into supervised autonomous machines. Every day, we hear contractor's say the biggest challenge facing their operation is a shortage of skilled labor. Teleo empowers contractor's existing operators with the power of remote operations and autonomy. This increases their comfort, safety, and satisfaction — attracting more operators and allowing them to do more.

